import React from 'react';

class OtherFeatures extends React.Component {
    render() {
        return (
            <div>
                <h2>Other Features</h2>
                <section>
                    <h3>Fields of Study</h3>
                    <p>Information about various fields of study offered by the IT Academy.</p>
                </section>
                <section>
                    <h3>Internships</h3>
                    <p>Details about available internships for students.</p>
                </section>
                <section>
                    <h3>Competitions</h3>
                    <p>Information on upcoming competitions and how to participate.</p>
                </section>
                <section>
                    <h3>Contact Information</h3>
                    <p>Contact details for inquiries and support.</p>
                </section>
            </div>
        );
    }
}

export default OtherFeatures;
